import './App.scss';
import Header from '../src/components/Header/Header.jsx'
import Product from '../src/components/Product/index.jsx'
import { Col, Row } from 'antd';

const data = [
  {
    id: 1,
    title: "Quần áo",
    img: 'https://sites.google.com/site/hinhanhdep24h/_/rsrc/1436687439788/home/hinh%20anh%20thien%20nhien%20dep%202015%20%281%29.jpeg',
    price: 100
  },
  {
    id: 2,
    title: "Ấm chén",
    img: "data:image/jpeg;base64,",
    price: 200
  },
  {
    id: 3,
    title: "Quần áo",
    img: 'data:image/jpeg;base64,',
    price: 300
  },
  {
    id: 4,
    title: "Máy bay",
    img: 'data:image/jpeg;base64,',
    price: 40
  },

]
function App() {

  return (
    <div className="App">

      <Header />

      <div className="main">
        <Row gutter={[16, 16]}>
          {
            data.map(element => (
              <Col span={6}>
                <Product data={element} />
              </Col>
            ))
          }
        </Row>
      </div>

    </div>
  );
}

export default App;
